    number: '6'
    value: 'In reference to FEC letter dated March 21, 2008:  The receipts that the
      FEC singled out were inadvertently shown as itemized in the FEC report due to
      a conversion error in the PAC program Vocus that resulted in earmarks being
      applied to these receipts in error.  The amounts in question were, in fact,
      totals of small unitemized contributions.  The conversion error did not affect
      any FEC totals and the newly filed End-of-Year report will not list these receipts
      as they are being accounted for in our unitemized totals due to the fact that
      all individuals that contributed did so under the $200 FEC threshold.  The APWU
      Committee on Political Action (COPA) has always made a concerted effort to attach
      names and addresses to each receipt we receive, and the APWU COPA will remain
      diligent in regards to this issue.'
